    "channel-islands-kelp-forest-monitoring-survey-1m-quadrat",nt"isopen": false,nt"url":
    null,nt"notes": "This dataset from the Channel Islands National Park's Kelp
    Forest Monitoring Program has measurements of the abundance (density) of relatively
    abundant selected sedentary indicator species.  The summary data presented here
    represents the mean density per square meter. Sampling is conducted annually between
    the months of May-October, so the Time data in this file is July 1 of each year
    (a nominal value). The actual measurements were taken at various depths, so the
    Depth data in this file is the depth of the station's temperature logger, which
    is a typical depth.",nt"license_title": null,nt"extras": [{ntt"key":
